function stringify3DArray(arr) {
    const parts = [];
    parts.push('[');
    for (let i = 0; i < arr.length; i++) {
        if (i > 0) parts.push(', ');
        const second = arr[i];
        parts.push('[');
        for (let j = 0; j < second.length; j++) {
            if (j > 0) parts.push(', ');
            const third = second[j];
            parts.push('[');
            for (let k = 0; k < third.length; k++) {
                if (k > 0) parts.push(', ');
                const element = third[k];
                if (typeof element === 'string') {
                    parts.push(JSON.stringify(element));
                } else if (element === null) {
                    parts.push('null');
                } else if (element === undefined) {
                    parts.push('undefined');
                } else if (typeof element === 'boolean') {
                    parts.push(element ? 'true' : 'false');
                } else {
                    parts.push(String(element));
                }
            }
            parts.push(']');
        }
        parts.push(']');
    }
    parts.push(']');
    return parts.join('');
}

